Name: setLowerBeamParameters
OpenCtrl:
PlausibilityCtrl:
Program: |+1
 param lowerBeamLocation:any
 
 //This method sets the lower beam settings for the joints.
 
 //Minimum amount of joints is two. This consists of:	"topBeam..." + "lowerbeam"
 //If three joints, it consists of:						"topBeam..." + "lowerBeam" + "lowerBeam_2"
 //If four joints, it consists of:						"topBeam..." + "lowerBeam" + "lowerBeam_2" + "lowerBeam_3"
 
 //Currently, maximum 5 joints is supported. If we need more, we just need to add more
 //lowerBeam's in each "topBeam..."'s hierarchy.
 
 //Fix first lowerBeam:
 var o := lowerBeamLocation.getObject("lowerBeam")
 o.jointLowerLimit := startAngle*-2
 o.jointUpperLimit := endAngle*-2
 o.aniRotationCenter := [beamLength/2,0, 0] --beamThickness/2] --lowerRotCenter --[beamLength/2, 0, 0]
 o.position[2] := 0
 
 //some checks
 if amountJoints < 2
 	debug --impossible!
 end
 if amountJoints > amountJointsMax
 	debug
 end
 
 //Fix active lowerBeams:
 for var a := 3 to amountJoints
 	--we want to have 3 or more joints
 	
 	o := o.getObject("lowerBeam_" + (a-1))
 	o.jointType := "Revolute Joint"
 	o.showGraphicGroup("default")
 	
 	if a = amountJoints
 		--we are at final joint
 		--at final joint we need to force a certain aniRotationCenter
 		--Otherwise the animated "spring" looks weird
 		if a mod 2 = 0
 			--even
 			o.jointLowerLimit := startAngle*-2
 			o.jointUpperLimit := endAngle*-2
 			o.aniRotationCenter := [beamLength/2, 0, 0] --beamThickness/2]
 		else
 			--not even
 			o.jointLowerLimit := startAngle*2
 			o.jointUpperLimit := endAngle*2
 			o.aniRotationCenter := [-beamLength/2, 0, 0] --beamThickness/2]
 		end	
 	elseif a mod 2 = 0
 		--even number
 		o.jointLowerLimit := startAngle*-2
 		o.jointUpperLimit := endAngle*-2
 		o.aniRotationCenter := [beamLength/2, 0, 0] --beamThickness/2]
 	else
 		--not even (first sub-beam!)
 		o.jointLowerLimit := startAngle*2
 		o.jointUpperLimit := endAngle*2
 		o.aniRotationCenter := [-beamLength/2, 0, 0] --beamThickness/2]
 	end
 
 	o.aniRotationAxis := [0,1,0]
 	o.position[2] := 0
 	o.position[3] := 0 --beamThickness/2
 next
 
 //deactivate the rest of lowerbeams
 for var a := amountJoints to amountJointsMax-1
 	o := o.getObject("lowerBeam_" + a)
 	o.hideGraphicGroup("default")
 	o.jointUpperLimit := 0
 	o.jointLowerLimit := 0
 	o.jointVelocity := 10000
 next
